bject_code` = `t_main`.`subject_code`) and (`t4`.`id` = `t5`.`yusuan_id`) and (`t5`.`month` = `t_main`.`month`)) group by `t_main`.`month`,`t_main`.`year_num`,`t_main`.`subject_code`,`t4`.`yusuan_type` order by `t_main`.`month` desc,`t_main`.`sort` ;

