DROP VIEW IF EXISTS `v_report_caiwushouzhi`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `v_report_caiwushouzhi` AS select `t1`.`subject_name` AS `subject_name`,`t1`.`subject_code` AS `subject_code`,`t1`.`month` AS `month`,`t1`.`shiji` AS `shiji`,`t2`.`shiji` AS `pre_shiji`,(case when isnull(`t2`.`shiji`) then '' when (`t2`.`shiji` > 0) then (((`t1`.`shiji` / `t2`.`shiji`) - 1) * 100) end) AS `tong_bi`,`t1`.`month_total` AS `month_total`,`t1`.`yusuan` AS `yusuan`,`t1`.`year_num` AS `year_num`,`t1`.`yusuan_shiji_bi` AS `yusuan_shiji_bi`,`t1`.`yusuan_cur_month_account` AS `yusuan_month_account`,round((((`t1`.`month_total` / `t1`.`yusuan_cur_month_account`) - 1) * 100),2) AS `account_yusuanshiji_bi`,`t1`.`type` AS `type`,`t1`.`sort` AS `sort`,`t1`.`yusuan_type` AS `yusuan_type`,(case when isnull(`t3`.`month_total`) then '' when (`t3`.`month_total` > 0) then (((`t1`.`month_total` / `t3`.`month_total`) - 1) * 100) end) AS `year_huan_bi`,`t3`.`month_total` AS `preyear_month_total`,`t1`.`year_yusuan` AS `year_yusuan`,((`t1`.`month_total` / (`t1`.`year_yusuan` * 10000)) * 100) AS `wancheng_bi` from ((`appfinance`.`v_shouzhi_shiji` `t1` left join `appfinance`.`v_shouzhi_shiji` `t2` on((((str_to_date(concat(`t1`.`year_num`,'-',`t1`.`month`,'-01'),'%Y-%m-%d ') - interval 1 month) = str_to_date(concat(`t2`.`year_num`,'-',`t2`.`month`,'-01'),'%Y-%m-%d ')) and (`t1`.`subject_code` = `t2`.`subject_code`)))) left join `appfinance`.`v_shouzhi_shiji` `t3` on((((str_to_date(concat(`t1`.`year_num`,'-',`t1`.`month`,'-01'),'%Y-%m-%d ') - interval 12 month) = str_to_date(concat(`t3`.`year_num`,'-',`t3`.`month`,'-01'),'%Y-%m-%d ')) and (`t1`.`subject_code` = `t3`.`subject_code`)))) where (`t1`.`yusuan_type` = 'shouzhi') group by `t1`.`subject_code`,`t1`.`month`,`t1`.`year_num`,`t1`.`yusuan_type` ;

